import React from 'react';
import './NewArrivals.css';

const NewArrivals = () => {
    return (
        <section className="new-arrivals">
            <h2>What's New</h2>
            <div className="carousel">
                <div className="item">
                    <img src="/path_to_new_arrival_image.jpg" alt="New Arrival" />
                    <p>New Arrival Description</p>
                    <a href="#" className="cta">Shop New Arrivals</a>
                </div>
            </div>
        </section>
    );
};

export default NewArrivals;
